INSERT INTO `article` VALUES (1, '春季时令蔬菜选购指南', '<h2>春季时令蔬菜选购指南</h2><p>春季是许多蔬菜的丰收季节，选购时令蔬菜不仅新鲜美味，而且营养价值更高...</p><p>1. <strong>菠菜</strong>：春季菠菜最为鲜嫩，富含铁元素和维生素C</p><p>2. <strong>春笋</strong>：清明前后的春笋最为鲜美，含有丰富的膳食纤维</p><p>3. <strong>韭菜</strong>：\"春食则香，夏食则臭\"，春季韭菜最为鲜嫩</p>', '春季是蔬菜的丰收季节，本文介绍如何选购春季最新鲜的时令蔬菜', '/img/1744817412185.png', 1251, 1, '2025-04-16 23:29:28', '2025-04-16 23:29:28');
INSERT INTO `article` VALUES (2, '有机蔬菜的5大健康益处', '<h2>有机蔬菜的5大健康益处</h2><ol><li><strong>农药残留低</strong>：有机种植不使用化学农药，食用更安全</li><li><strong>营养价值高</strong>：研究表明有机蔬菜维生素含量比普通蔬菜高20-40%</li><li><strong>味道更鲜美</strong>：自然生长的蔬菜保留了原有的风味</li><li><strong>环保可持续</strong>：有机种植方式更有利于土壤保护</li><li><strong>支持本地农业</strong>：购买有机蔬菜支持了本地农户的可持续发展</li></ol>', '了解为什么有机蔬菜值得更高的价格，以及它们对健康的独特益处', '/img/1744817426398.png', 980, 1, '2025-04-16 23:29:28', '2025-04-16 23:29:28');
INSERT INTO `article` VALUES (3, '10种最适合家庭阳台种植的蔬菜', '<h2>阳台种菜指南</h2><p>即使没有菜园，也可以在阳台种植这些容易生长的蔬菜：</p><ul><li><strong>小番茄</strong>：品种多，结果期长</li><li><strong>生菜</strong>：生长快，可以多次采摘</li><li><strong>香葱</strong>：耐寒耐热，随吃随摘</li><li><strong>樱桃萝卜</strong>：30天即可收获</li><li><strong>菠菜</strong>：耐阴，适合光照不足的阳台</li></ul><p>种植技巧：选择深度15cm以上的容器，使用营养土，保持适当间距...</p>', '城市居民也能享受种植乐趣，这些蔬菜最适合阳台小空间种植', '/img/1744817438478.png', 2100, 1, '2025-04-16 23:29:28', '2025-04-16 23:29:28');
INSERT INTO `article` VALUES (4, '如何正确保存蔬菜保持新鲜', '<h2>蔬菜保鲜全攻略</h2><p>不同蔬菜需要不同的保存方法：</p><table style=\"width: auto;\"><tbody><tr><th colSpan=\"1\" rowSpan=\"1\" width=\"auto\">蔬菜类型</th><th colSpan=\"1\" rowSpan=\"1\" width=\"auto\">保存方法</th><th colSpan=\"1\" rowSpan=\"1\" width=\"auto\">保存时间</th></tr><tr><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">叶菜类</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">用厨房纸包裹后放入保鲜袋</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">3-5天</td></tr><tr><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">根茎类</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">擦干表面水分后冷藏</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">1-2周</td></tr><tr><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">菌菇类</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">纸袋包装保持透气</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">5-7天</td></tr></tbody></table><p>特别提示：西红柿、黄瓜等不宜冷藏，会失去风味...</p>', '学会这些专业方法，让你的蔬菜保鲜时间延长2-3倍', '/img/1744817452910.png', 1560, 1, '2025-04-16 23:29:28', '2025-04-16 23:29:28');
INSERT INTO `article` VALUES (5, '从农场到餐桌：蔬菜供应链揭秘', '<h2>蔬菜供应链全解析</h2><p>一颗蔬菜从田间到您的餐桌经历了怎样的旅程？</p><p>1. <strong>种植环节</strong>：现代化农场采用智能温室、滴灌技术</p><p>2. <strong>采收环节</strong>：凌晨采收保持蔬菜新鲜度，专业分拣</p><p>3. <strong>冷链运输</strong>：全程冷链确保蔬菜在最佳状态下运输</p><p>4. <strong>质量检测</strong>：每批次蔬菜都经过农残检测和品质把控</p><p>5. <strong>配送环节</strong>：最后一公里采用专业蔬菜配送车辆</p>', '深入了解现代蔬菜供应链如何保证您餐桌上的蔬菜新鲜安全', '/img/1744817461003.png', 891, 1, '2025-04-16 23:29:28', '2025-04-16 23:29:28');
