INSERT INTO `notice` VALUES (33, '新鲜水果预售开启！', '本周新鲜水果预售活动开始啦！包括：\n1. 陕西洛川苹果 5斤装 特惠价39.9元\n2. 四川蒲江猕猴桃 12个装 特惠价29.9元\n3. 海南小台农芒果 3斤装 特惠价45.8元\n预售时间：2024-03-20至2024-03-25，提前下单享受优惠！', '2024-03-20 08:00:00', '预售,特惠');
INSERT INTO `notice` VALUES (34, '平台质量管理公告', '为保证农产品质量，平台已开展春季质量检查行动：\n1. 所有入驻商家需提供最新食品经营许可证\n2. 农产品抽检频率提升至每周两次\n3. 生鲜类商品运输全程冷链配送\n请广大用户放心购买！', '2024-03-18 10:30:00', '质量管理,公告');
INSERT INTO `notice` VALUES (35, '产地直采：春季蔬菜上新', '本周产地直采蔬菜新品：\n- 山东寿光大棚小番茄\n- 云南高原生菜\n- 江苏徐州新鲜土豆\n所有商品均为24小时内直达，产地直采价格更优惠！', '2024-03-15 09:00:00', '蔬菜,直采,新品');
INSERT INTO `notice` VALUES (36, '物流配送通知', '因春季天气多变，部分地区可能出现配送延迟。我们已增加配送人员，确保生鲜商品及时送达。如遇极端天气，客服会第一时间联系您！感谢理解！', '2024-03-12 14:00:00', '物流,通知');
